import React from 'react';

const Header: React.FC = () => {
  return (
    <header className="flex items-center justify-between p-4 bg-black text-white">
      <div>
        <img src={'https://www.tucarga.com.co/logo.png'} alt="TuCarga Logo" className="h-10" />
      </div>
      <nav className="hidden md:block">
        <ul className="flex space-x-6">
          <li><a href="#" className="hover:text-primary">Inicio</a></li>
          <li><a href="#" className="hover:text-primary">Servicios</a></li>
          <li><a href="#" className="hover:text-primary">Sobre Nosotros</a></li>
          <li><a href="#" className="hover:text-primary">Contacto</a></li>
        </ul>
      </nav>
      <div>
        <button className="border border-primary text-primary hover:bg-primary hover:text-black px-4 py-2 rounded-md transition duration-300">
          Iniciar sesi√≥n
        </button>
      </div>
    </header>
  );
};

export default Header;
